g2:c.PROCEDURE.g2:a.TEXT:
get-scrollbar-position-is-equal-to-set-test (node: class benchmark-test )
x: class g2-window;
y: class g2-window;
id: integer;
passed: truth-value ;
error-msg1: text;
error-msg2: text;
error-msg3: text;
error-msg: text;
begin
passed = true;
error-msg1 = "";
error-msg2 = "";
error-msg3 = "";
for x = each g2-window do
    if the g2-window-management-type of x is remote then y = x;
end;
call post-selected-dialog (grid-view-example,y);
id = the returned-dialog-id of grid-view-example ;
call g2-ui-grid-view-set-hscroll-position(id, the symbol my-sole-grid-view, 25, y);
wait for 7 seconds;
call g2-ui-grid-view-get-hscroll-position (id,the symbol my-sole-grid-view, hs-pos, y);
if the value of hs-pos /= 25 then begin
    passed = false;
    error-msg1 = "The horizontal scrollbar position just got [the value of hs-pos] is not equal to what is set."
end;
call g2-ui-grid-view-set-vscroll-position(id, the symbol my-sole-grid-view, 10, y);
wait for 7 seconds;
call g2-ui-grid-view-get-vscroll-position (id,the symbol my-sole-grid-view, vs-pos, y);
if the value of vs-pos /= 10 then begin 
    passed = false;
    error-msg2 = "The vertical scrollbar position just got [the value of vs-pos] is not equal to what is set."
end;
call g2-ui-grid-view-set-scroll-positions (id,the symbol my-sole-grid-view,50,20,y);
wait for 7 seconds;
call g2-ui-grid-view-get-scroll-positions(id,the symbol my-sole-grid-view,hs-pos,vs-pos,y);
if the value of vs-pos /= 20 or the value of hs-pos /= 50 then begin 
    passed = false;
    error-msg3 = "The g2-ui-grid-view-get-scroll-positions result ([the value of hs-pos], [the value of vs-pos]) not equal to what is set by g2-ui-grid-view-set-scroll-positions."
end;
if passed is true then call pass(node) else begin
    error-msg = "[error-msg1] [error-msg2] [error-msg3]";
    call fail(node, error-msg);
end;
end

invalid-scroll-position-set-test(node: class benchmark-test)
x: class g2-window;
y: class g2-window;
id: integer;
s: symbol;
t: text;
begin
for x = each g2-window do
    y = x;
end;

begin
id = the returned-dialog-id of grid-view-example;
call g2-ui-grid-view-set-hscroll-position(id, the symbol my-sole-grid-view, -1, y);
call g2-ui-grid-view-set-vscroll-position(id, the symbol my-sole-grid-view, 100000, y);
call g2-ui-grid-view-set-scroll-positions (id,the symbol my-sole-grid-view, 100000, -1, y);
end on error (s,t) begin
call fail(node,t);
end;
end;
call pass(node);
end
